import React from "react";
import { Typography, Box, Button, Avatar, Input } from "@material-ui/core";


const login = () => {
  return (
    <body style={{ margin: "0px" }}>
      <Box>
        <Box
          style={{
            marginLeft: "400px",
            marginRight: "400px",
            height: "600px",
            background: "#F2F3F7",
            borderRadius:"8px"
          }}
        >
          <Typography
            style={{
              marginTop: "20px",
              paddingTop: "15px",
              textAlign: "center",
              fontSize: "30px",
              color:"#636363"
            }}
          >
            Register
          </Typography>
          <Typography style={{textAlign:"center",paddingTop:"8px",color:"#B19B9A"}}>
            Create your account. It's free and only takes a minute.
          </Typography>
        </Box>
        <Input  type="password"
            style={{
              backgroundColor: "#ffffff",
              border: "1px solid #CCCCCC",
              borderBottom: "1px solid #CCCCCC",
              borderRadius: "4px",
              padding: "0px 10px",
            }}
            placeholder="Enter your Password "
          />
        <Box>

        </Box>
      </Box>
    </body>
  );
};
export default login;
